	return document.getElementById(s);

function decrypt(p) {
	try {
		var dec = CryptoJS.AES.decrypt(pdfData, p).toString(CryptoJS.enc.Utf8);
		if(dec != "") {
			o("encrypted").style.opacity = "1";
			o("copy").style.visibility = "visible";
			o("alert").innerHTML = "";
			o("alert").outerHTML = "";
			o("viewer").style.visibility = "visible";
			render(atob(dec));
		} else {
			o("decryption-result").innerHTML = "<strong>Неправильно!</strong>";
		}	
	} catch(e) {
		o("decryption-result").innerHTML = "<strong>Неправильно!</strong>";
	}
}

function trydec() {
